glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
in float a_dist;
out float v_dist;
void main () {
  vec4 pos = vec4(a_position, 1);
  pos = cc_matViewProj * cc_matWorld * pos;
  v_color = a_color;
  v_dist = a_dist;
  gl_Position = pos;
}

glsl3.frag:
#if CC_SUPPORT_standard_derivatives
  #extension GL_OES_standard_derivatives : enable
#endif
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
in vec4 v_color;
in float v_dist;
float Remap01(float a, float b, float t) {
  return (t-a) / (b-a);
}
float Remap(float a, float b, float c, float d, float t) {
  return Remap01(a, b, t) * (d-c) + c;
}
float Pulse(float x) {
  x *= 0.4;
  x = x + 0.5;
  float k = 16.;
  return pow(4.0 * x * (1.0 - x), k);
}
void main () {
  float alpha = abs(v_dist);
  float outlineWidth = 0.5;
  float centerAlpha = 0.;
  float alphaDist = abs(alpha - centerAlpha);
  float mask = smoothstep(outlineWidth, 0., alphaDist);
  vec4 col = v_color;
  col.a = mask;
  float brightness = Remap(0., 1., 0.6, 1.0, 0.8);
  col.rgb += Pulse(alphaDist) * brightness;
  col.rgb *= col.a;
  gl_FragColor = col;
}

